import React from 'react'

function AdmissionTickets() {
    return (
        <iframe>
        <div id="tc-container-iframe"></div>
<script src="https://ticketscandy.com/js/tc_widgets.js"></script>
<script>
document.addEventListener('DOMContentLoaded', function(event) {
    TCWidget.init('tc-container-iframe', 'https://ticketscandy.com/event/adventureroominstamuseum/tickets/')
});
</script>
        </iframe>
    )
}

export default AdmissionTickets;
